import { NgModule } from '@angular/core';
import { CommonModule } from '@angular/common';
import { FormsModule } from '@angular/forms';

import { IonicModule } from '@ionic/angular';

import { ConsultationMedPageRoutingModule } from './consultation-med-routing.module';

import { ConsultationMedPage } from './consultation-med.page';

@NgModule({
  imports: [
    CommonModule,
    FormsModule,
    IonicModule,
    ConsultationMedPageRoutingModule
  ],
  declarations: [ConsultationMedPage]
})
export class ConsultationMedPageModule {}
